import React from "react";
import { Navbar } from "./components/Navbar";
import { Footer } from "./components/Footer";
import { Routes } from "./components/Routes";
const App = () => {
  return (
    <div>
      <h1>App</h1>
      <Navbar />
      <Routes />
      <Footer />
    </div>
  );
};

export default App;
